import React from 'react';
import {Link} from 'react-router-dom'

function Auth() {
  let login="admin"
  let password="amin"
  let checked=false
  let rou
  if (login==="admin" && password==="admin") {checked=true}
  if (checked) rou = "/"
  return (
    <div>
      Auth
      <Link to={rou}>Auth</Link>
    </div>
  )
}

export default Auth;
